import { useState, useEffect } from "react";
import { getAllAgents } from "../Repositories/agencyRepos";
const Login = () => {
    const [agents,setAgents] = useState([])

    const [selectedAgent,setSelectedAgent] = useState('')

    const [errors,setErrors] = useState(true)

    const [message,setMessage] = useState('')

    const fetchAgents = async() =>{
        try{
            let data = await getAllAgents()
            if(data){
                setAgents(data)
            }
        }catch(error){
            setErrors(true)
            console.log(error)
        }
    }

    return (
        <main id="main" className="main">
            <div className="container-md">
                <div className="card">
                    <div className="card-body">
                        <br />
                        {
                            errors && <div className="alert alert-danger">{message}</div>
                        }
                        <br />
                        <div className="row">
                            <div className="col-2"></div>
                            <div className="col-8">
                                <div className="row">
                                    <div className="col-4">
                                        <label htmlFor="#agent" className="form-label">Select Agency</label>
                                    </div>
                                    <div className="col-8">
                                        <select name="agent" id="agent" className="form-select">
                                            <option value="">Please Select</option>
                                        </select>
                                    </div>
                                    <br /><br />

                                </div>

                                <div className="row">
                                    <div className="text-center">
                                        <button className="btn btn-primary">Login</button>
                                    </div>
                                </div>
                            </div>
                            <div className="col-2"></div>
                        </div>
                    </div>
                </div>
            </div>
        </main>
    )
}

export default Login;
